 tools to the unbanked with a medium to create financial credibility is to the core belief and the roots of the creator of the Planet One Decentralized Cryptocurrency Exchange.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-white&quot;&gt;On one hand, clean education has become a top priority for United Nations (UN) and World Health Organization (WHO). On the other hand, a systematic approach to give financial credibility to the hands of 3.2 billion + unbanked people in the world needs the highest attention.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-white&quot;&gt;With a view to address and uplift the two key areas of Education and Finances, Planet One Dex will offer a 1000 Billion Initial Coin Offering (ICO) within the coming months. A detailed white paper on ICO and its guidelines will be released soon. &lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-white&quot;&gt;The founders of Planet One Dex have extensive knowledge and years of experience of addressing the core education corridor within India on subjects of clean education in line with the guidelines of the UN and WHO. In particular this includes safety, security, health, hygiene, segregation of waste management, conservation, environment, systematic cooperation by respecting one other.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-white&quot;&gt;By enriching these fundamental qualities within people, it is a stepping stone to the basics of living in a balanced natural world.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-white&quot;&gt;With the launch of the ICO, we will work extensively in Asia, Africa, and South America to uplift people&rsquo;s lives through education and by providing access to finances to the hands of unbanked people worldwide.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-white&quot;&gt;The basis to live a life is to &ldquo;HAVE A SHELTER &ndash; FOOD ON THE PLATTER FOR THE FAMILY &ndash; AND MONEY FOR EDUCATION FOR THE CHILDREN&rdquo;. This is &ldquo;TRUE ABUNDANCE&rdquo;. Let us join hands to uplift those who are not th