INSERT INTO `tgg_faq` VALUES (1,NULL,1,'How To Withdraw Funds','Tron Googol is based on a decentralised model. This means that Tron Googol holds no funds themselves.\r\n\r\nAs participates join and raise community funds, this gets evenly distributed to the network accordingly within the 4 cycles. \r\n\r\nTherefore, there is no withdraw option on Tron Googol. As you earn from each cycle, this gets automatically populated into your wallets. \r\n\r\nAll transactions are visible via your own wallet and also on TronScan.',NULL,NULL,'2021-05-13 23:36:18','2021-05-14 14:19:31',1),(2,NULL,1,'How to get my link to refer others','<p>To obtain your link which you can share with others, follow these steps:</p>\r\n\r\n<p>1) Ensure your wallet is connect to the dapp</p>\r\n<p>2) Click on My Profile</p>\r\n<p>3) Click on Copy Referral Link</p>\r\n\r\n<p>In order to share your personal link, ensure that your Core 7 team has been formed.</p>\r\n\r\n<p>If your Core 7 team has not been formed as yet, click on “Copy Sponsors Link”.</p>\r\n\r\n<p>This will enable you to use your sponsors link, which in turn by default will form your Core 7. Once your Core 7 has been formed, you can then use your personal link to share. </p>\r\n\r\n<p><b>Teamwork Is Key</b></p>',NULL,NULL,'2021-05-13 23:33:11','2021-05-14 14:19:31',1),(3,NULL,1,'How To Clear My Cache?','<p>As Tron Googol functions on a Smart Contract on the blockchain, there are times outside of the control of Tron Googol, that your wallet does not connect to the Tron network. </p>\r\n\r\n<p>This will result in data not populating on the “My Profile” page or the total transacted amount not populating on the home page. It will also mean that you cannot join the $25, $50 or the $100 boards.</p>\r\n\r\n<p>To overcome this, you can refresh your browser until it does connect.</p>\r\n\r\n<p>If this does not work, you can clear the cache memory of your browser. </p>\r\n\r\n<p>1. To do this for PC users Press and hold the button CTRL on your keyboard and then press F5 and let go</p>\r\n\r\n<p>2. For Apple Mac users, press and hold the Cmd button, Shift and the letter “R”. </p>\r\n\r\n<p>This will refresh the page and you should see the green notice box as shown below.\r\nIf the green notice box does not show, repeat the steps above to clear your browser cache until it does. (Ctrl F5 or Cmd Shift + R).</p>',NULL,NULL,'2021-05-13 23:17:19','2021-05-14 14:19:31',1),(4,NULL,2,'What is Lorem Ipsum? ','  Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. Lorem\r\n                                                            Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type\r\n                                                            and scrambled it to make a type specimen book. Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the\r\n                                                            1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.',NULL,NULL,'2021-05-06 06:45:58','2021-05-14 14:19:31',1),(5,NULL,2,'Where does it come from?',' Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum\r\n                                                            has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. Lorem Ipsum is simply dummy text\r\n