our TronLink Wallet and select the wallet you join Tron Googol with.</li>\r\n<li>Press the “Freeze” icon</li>\r\n</ol>\r\n<p><img src=\"https://lh3.googleusercontent.com/5Ve-ckV-vUPbgF4e3sV_eGCxfTxuRRru6qpIOFvE4z0pfXmOj8NTD5fcECewSKYa3k9GSfw2dGhKiHeAXO3krD6_7ysh5PDLp0LltkCPe3GH9-f7naiPQ8aVVGQAbnr4ypCdHFtD=w2400\" alt=\"\"></p>\r\n<p>This will open up a new window.</p>\r\n<ol start=\"3\">\r\n<li>On the top right of the screen, click on “Obtain”</li>\r\n</ol>\r\n<p><img src=\"https://lh3.googleusercontent.com/7zAuYBgbKooUsgWtUwXaZ-Vkcf68UZZJVtnmdTCCqUDb4ZmPg0FIQo-y89qetf2mw6Pg25dYMXepjuUK8IObfI7vSoTrXdyTfoOmeHXERgQ_tPSkyXWywhcKqiBTm-rZW259deg-=w2400\" alt=\"\"></p>\r\n<p>4. On the first option, click on the dropdown box and select Tron Power and Energy</p>\r\n<p><img src=\"https://lh3.googleusercontent.com/OGHps615Dn3767_VTanofGxqHqaPM9Tu2vHcs31w096jr5iWfGJMZ34QMqx9coQ7cLl3r2za8D3j9fuMr-a3ePHnzOL2CTA46x1LH7B0V66CfluLiDL5mlVw0EeErMYaMGb4F-o4=w2400\" alt=\"\"></p>\r\n<p>5. It is suggested to freeze at lease 100 Tron. Once confirmed, press on the Freeze and accept. The Tron will be frozen for 72 hours. After 72 hours you will receive this back into your wallet. Please ensure you have enough in your wallet to still join Tron Googol as now some of your Tron has been frozen/reserved so it cannot be used</p>\r\n<p> </p>\r\n<p><strong>Important: </strong>There are times when the Tron chain will deduct from your TRX balance if it does not have enough energy. This is outside of the control of Tron Googol and any additional transaction amount goes towards the Tron chain as network fees.</p>',NULL,NULL,'2021-05-16 20:47:55','2021-05-14 14:19:31',1),(47,NULL,1,'Explain The Concept','<p>In order to fully understand the concept behind Tron Googol, we suggest watching the official business presentation.</p>\r\n\r\n</p><a href=\"https://youtu.be/AIxQRhDbhjc\">Official Business Presentation Video</a></p>\r\n\r\n<p>Tron Googol is based on the concept of crowdfunding. The concept is nothing new apart from the fact we are using Blockchain technology. </p>\r\n\r\n<p>There are numerous examples of crowdfunding in operation today, whether to raise funds for a charity, start-up company or to help the community. </p>\r\n\r\n<p>In Asian culture, the members of a family will put in money to contribute to one family starting a business. Then all of the family members will work at that business, until enough wealth is generated to open the next families business. </p>\r\n\r\n<p>In Jamaican culture, individuals give a certain amount of money to a designated person on a weekly basis and at the end of the year, all the money you have given is fully returned. There is no additional profit or interest made on the contribution of each individual.</p> \r\n\r\n<p>In Hispanic culture, families contribute a fix amount of money to another family for a set period of time. Once that defined period passes, each family continue to contribute and then the next family collects. There is no profit or interest made on the contribution.</p>\r\n\r\nAll of these 3 methods still occurs today and is built on the model of crowdfunding and helping each other within that community. Crowdfunding has been happening for over 200 years. The only difference now with Tron Googol is that all of this is automated and done through a smart contract using blockchain technology. All transactions are transparent via the open ledger and automatically done for you without any holds of funds.',' ','1621085084.png','2021-05-15 13:26:02','2021-05-14 14:19:31',1),(48,NULL,1,'What is a smart contract?','<p>Tron Googol is a smart contract which is available on the Tron Blockchain. It is completely audited and verified by an independent company. </p>\r\n\r\n<p>A smart contract is basically a protocol or program that has been put into the blockchain whereby no one, including the designers or developers of Tron Googol can change the rules and all transaction are transparent and you have full visibility. </p>\r\n\r\n<p>There are no mediators or intermediaries and no human interaction, which is effectively guaranteeing the fairness of all people participating their funds according to the rules of the Smart Contract.</p>\r\n\r\n<p>We believe it is the most reasonable, safest, and best cutting-edge financial support model available at this time.</p>\r\n\r\n<p>To start a Smart Contract, there is no need to register with your email or phone number or name or address. All we need is for you to have a wallet topped up with Tron currency. </p>',NULL,NULL,'2021-05-13 23:35:28','2021-05-14 14:19:31',1),(49,NULL,1,'Do I have to refer others?','<p>You do not need to refer others. Just like any other crowdfunding platform, the more people that participate, the more funds that will be raised and therefore, the more that will get distributed.</p>\r\n\r\n<p>It is not a requirement to have to refer others. However, if you do, then this benefits the community as everyone can earn faster.</p>\r\n\r\n<p>As a minimum, once you refer 2 people using your referral link, you are entitled to join the $50 and $100 boards.</p>\r\n\r\n<p>If you are able to refer more than 2 people by sharing this great opportunity, then the faster everyone will earn.</p>\r\n\r\n<p>Through marketing campaigns, Tron Googol will also promote the platform. Anyone that joins through the marketing campaign will get spilled over and populate any empty positions. </p>\r\n\r\n<p>However, participants should not rely on this as the most powerful way to grow the network is word of mouth, which can only come from the participants. </p>',NULL,NULL,'2021-05-13 23:39:12','2021-05-14 14:19:31',1),(50,NULL,1,'What is a Closed Matrix?','<p>Tron Googol operate via a closed matrix.</p>\r\n\r\n<p>This unique compensation system ensures that everyone gets paid fairly, true spillovers can occur and any participant can join months after another participant and earn much more than them.</p>\r\n\r\n<p>In a closed matrix there are 63 positions in total. Of which 7 of these are the Core 7 team and 56 on the outside. </p>\r\n\r\n<p>The nature of Tron Googol is that the purple positions pay other purple positions, Pink positions pay other pink positions. Green positions pay other green position.</p>\r\n\r\n<p>On each board of 63, the Core 7 team get paid from 8 members each (8 multiplied by 7 equals 56). </p>\r\n\r\n<p>This ensures that the Core 7 participants all work as a team and also get paid the exact same.</p>\r\n\r\n<p>This makes it a fair system for everyone that participates and advantageous over any other platform in the networking space. </p>','<iframe width=\"480\" height=\"315\" src=\"https://www.youtube.com/embed/AIxQRhDbhjc\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','1621079159.jpg','2021-05-15 11:48:05','2021-05-14 14:19:31',0),(51,NULL,1,'What happens when my board of 63 is full?','<p>When a board gets filled with 63 members it gets split automatically into 8 individual separate boards. </p>\r\n\r\n<p>In a board of 63, 7 of those are the Core 7 team.</p>\r\n\r\n<p>This leaves 56 people remaining.</p>\r\n\r\n<p>56 divided by 8 equals 7.</p>\r\n\r\n<p>This means that when a board gets filled, 8 further teams of 7 get formed. </p>\r\n\r\n<p>They will get their own boards each and the members become the “Core 7”, or the people in the middle of the new boards. </p>\r\n\r\n<p>If your board of 63 is full, and you refer others to join using your link, those members will get spilled over and populate one of the empty positions on the 8 split boards. </p>',NULL,'1621085475.png','2021-05-15 13:31:15','2021-05-15 13:27:38',1),(52,NULL,1,'Why can’t I get access to my referral link straight away?','<p>The concept behind Tron Googol is to work as a team to raise funds. Once the funds have been raised, this gets evenly distributed across the network. This is the basis of the decentralised crowdfunding platform. </p>\r\n\r\n<p>In this unique concept, every participant works in a team of 7. This increases the chances of people succeeding and earning. The team of 7 is known as the CORE 7. </p>\r\n\r\n<p>By using this method, it means that no one is left behind. All previous boards are completed first before the next boards can be generated. This ensures that no one is left behind in this amazing opportunity. This is unlike MLM where the networks/trees/arms can vary depending on the efforts of a few and only a few people at the top actually generate any funds. In Tron Googol, everyone in the family benefits and no one gets left behind </p>\r\n\r\n<p>Therefore, when you join, you only get access to your personal link once your core 7 is formed. </p>\r\n\r\n<p>If you want to refer people prior to your core 7 being formed, you do not have to wait. You can work as a team</p>\r\n\r\n<p>Click on My Profile</p>\r\n\r\n<p>Click on “Copy Sponsors Link”</p>\r\n\r\n<p>This will enable you to use the link of your sponsor. When people join, this will by default populate your own board and core 7.</p>\r\n\r\nTo fully understand, we suggest watching the following video:\r\n\r\n<a href=\"https://youtu.be/jhCL5weOf2Y?t=840\">Link Explanation</a>',NULL,NULL,'2021-05-16 20:38:41','2021-05-15 13:35:50',1),(53,NULL,1,'How To Join Step 1: Create a digital wallet','<p>As Tron Googol functions on a Smart Contract on the blockchain, to join, you have to use the Tron crypto currency. The first step is to create a wallet where you can hold and store Tron. This wallet is unique to you and will be the location where you will send and receive Tron from Tron Googol.</p>\r\n<p>There are many wallets available which can be used to join Tron Googol. Our recommendation is to use TronLink Pro as advised by the Tron Foundation.</p>\r\n<p>TronLink Pro is available as a desktop extension as well as a mobile application. This means that it can be used on a PC, Laptop, as well as a mobile device (Android or iOS).</p>\r\n<p>In order to use it on a PC or laptop, you have to use the Google Chrome Internet browser.</p>\r\n<ol>\r\n<li>Click on the following link and download the Chrome extension</li>\r\n</ol>\r\n<p><a href=\"https://chrome.google.com/webstore/detail/tronlink（波宝钱包）/ibnejdfjmmkpcnlpebklmnkoeoihofec\">https://chrome.google.com/webstore/detail/tronlink（波宝钱包）/ibnejdfjmmkpcnlpebklmnkoeoihofec</a></p>\r\n<ol start=\"2\">\r\n<li>Once Installed, on the top right of your Google Chrome browser, click on the “Extensions” icon and pin the TronLink Pro application so that it always appears as a shortcut on your browser.</li>\r\n</ol>\r\n<p><strong>Extension Icon</strong></p>\r\n<p><strong><img src=\"https://drive.google.com/file/d/1qAdSGjpH-5Th9ZADr_f6avEQ5WFHjO5Z/view?usp=sharing\" alt=\"\"></strong><strong><img src=\"https://lh3.googleusercontent.com/bkj8RNKghFuJ5Liw9K4jeD7hQyEvGwEIZ3N1TUBVLjA-qRCgIu88LtBNRFf0udHKlAzV1Fu2ZYRKkkC8M5Ol8Gq2OgOU-u34xS3TQw016BYhWYD8uB9tv7Gryt85VTFtEbcuA5Cs=w2400\" alt=\"\"></strong></p>\r\n<p><strong>Pin Tron Link Icon</strong></p>\r\n<p><img src=\"https://lh3.googleusercontent.com/Nmg_bQP4wMseErS_VR6YO_-mU4cCYvFVwD4-2OYv6BM9OjjzopExvSSPsn9eBn0K1SahUH0NI0O5WlcMG5aNzU1U6LGJJUR60bZ-88CoI7TN_7KHNCWjHJ-D21AxhGlkSINjdKrb=w2400\" alt=\"\"></p>\r\n<ol start=\"3\">\r\n<li>Next click on the icon and create a new account.</li>\r\n</ol>\r\n<p><strong> </strong><strong>Important: </strong>Please take a note of the password as this cannot be recovered if forgotten</p>\r\n<ol start=\"4\">\r\n<li>Next click on Create Wallet</li>\r\n</ol>\r\n<p>        Enter a Wallet Name</p>\r\n<p><img src=\"https://lh3.googleusercontent.com/GRvkmOQcvFj9Cc_RVk5abfkzPuXa_PnIqm92bri2T-hkF0NUbUzcLwQBKY3CW7diprSIidy1nW-_nC-nPolO9xgWlFr30DBLTtKgav3cX1VJRCw_g2nX-cCKhUMuZHUq3_KcxtjW=w2400\" alt=\"\"></p>\r\n<ol start=\"5\">\r\n<li>You will then be presented with your mnemonic phrase. Please take a note of this phrase and write it down.</li>\r\n</ol>\r\n<p><strong> </strong><strong>Important: </strong>In order to recover your wallet in the future you will need this mnemonic phrase so please store it somewhere safe. <strong><u>Do not lose the 12 words</u></strong></p>\r\n<p> </p>\r\n<p><img src=\"https://lh3.googleusercontent.com/xb2mV8_h7FFOGLBdHm5yIyyLg53h7Jtg0e_Pq24hqc-URbOPwaLlBcmibV0uDI2vs2kbHDi_YnFU1aV3XTHhLbMztDwalEkQ4UdrquJEi3q26wwfm6suOrjiKwJ0LeqXITF8MK16=w2400\" alt=\"\"></p>\r\n<ol start=\"6\">\r\n<li>Once you press continue, you will be prompted to re-enter the phrase in the same order as you see it on the screen</li>\r\n</ol>\r\n<p><img src=\"https://lh3.googleusercontent.com/lmayf5R6b6OeBdaNWIgYbiu8xJaFjoaIQwaQTv9SR41dlmTxzEmM9iPqWOgVZMuPYldc4N7sjysQWZq3_kI5H0LmH8h1YyD_VgUNYuBqmNoIi7BV8z6XUoklrX0PToQMHcjQJT6p=w2400\" alt=\"\"></p>\r\n<p>Once entered correctly, you can press confirm and then your wallet is created</p>\r\n<p><strong>Important:</strong> It is good practice to keep a record of your wallet ID and your private key in case you need to recover your account in the future.</p>\r\n<ol start=\"7\">\r\n<li>Your wallet ID can be copied by pressing the icon</li>\r\n</ol>\r\n<p><img src=\"https://lh3.googleusercontent.com/o4ES1VghF4lh356HQb7VXLPJsUSA4nAB6z0Gt8np-GIr_u7b1o99PYuV45VJSp6ksG8syq41j-rp6IARYq9p51lrB0uiyNwHkh0LG-KwudPmdd-PernVZyrRXwVDhVZL2ZdVkoZN=w2400\" alt=\"\"></p>\r\n<ol start=\"8\">\r\n<li>To get your private key, press the menu 3 lines option</li>\r\n</ol>\r\n<p><img src=\"https://lh3.googleusercontent.com/-unW_H6xenp8SKQuNVkLybL-C5h0eQ6gblg2fWb4Tvem9tfbTN1ozE8iPw5oeFMToPc44hjgewLMHwwipBKDDbsh8mZnW3vcEuEh5cHxda-HjCkEJARH19UvBfeQGKLHARyJKWYM=w2400\" alt=\"\"></p>\r\n<p>Then from the drop down list press Export Account</p>\r\n<p><img src=\"https://lh3.googleusercontent.com/wR5vdO4Tl_MrIuwqOSn_iH66ebH_2_MQqsNyZFdZzDAbiSoBB2SARN3DtrmmjUtltIM0Ed_-pg8qD9FyfmSKVSilFl7UwqFLinn8EFMX8kYA84lIv2W_bpiI1Xo4km9otGfaKPf3=w2400\" alt=\"\"></p>\r\n<p>Enter your account password and then press “Private Key”</p>\r\n<p><img src=\"https://lh3.googleusercontent.com/vNhuRZf2uIM8rhS87vsHp64CP2S6eOcbvmzGpgjZbvhMKUnysXKKKb1oT-8rPLKE0WS4qePjsYFQenyjPg-NvdYUKdFfCpNV0f3qbRMx0l9yScjA98TYQSIrFjJAlAOiC2S_GvKB=w2400\" alt=\"\"></p>\r\n<p>You will then be presented with your private key. Please take note of this key and store it somewhere safe. This will be required if you want to restore your wallet in the future</p>\r\n<p>Your wallet is now ready for funds to be transferred into.</p>\r\n<p> </p>\r\n<p><strong>MOBILE</strong></p>\r\n<p>TronLink Pro also have a mobile application. Once you download the app from Google Play Store or the Apple App Store, the process to create a wallet is the same. Follow the instructions and take note of the mnemonic phrase and private key</p>',NULL,NULL,'2021-05-16 20:20:18','2021-05-15 13:43:07',1),(54,NULL,1,'How To Join Tron Googol','<p>The process to join Tron Googol can be completed in 3 simple steps.</p>\r\n\r\n<p>Please watch the short videos below which explain how to join:</p>\r\n\r\n<p><a href=\"https://youtu.be/ypmnglQSJOw\">Step 1: Create a digital wallet</a></p>\r\n\r\n<p><a href=\"https://youtu.be/g6kzUXAL2-o\">Step 2: Fund your digital wallet with Tron</a></p>\r\n\r\n<p><a href=\"https://youtu.be/fFRRheEXHrE\">Step 3: Join Tron Googol</a></p>',NULL,NULL,'2021-05-16 19:52:19','2021-05-16 19:47:55',1),(55,NULL,1,'How To Join Step 2: Fund Wallet','<p>The next step is to convert your fiat currency into crypto currency.</p>\r\n<ol>\r\n<li>To do this, go to <a href=\"http://www.TronGoogol.io\">TronGoogol.io</a> and scroll down the page until you see the following:</li>\r\n</ol>\r\n<p><img src=\"https://lh3.googleusercontent.com/Q00pRhtkWYQNZpRWypMPbV9dzM7CrhDhkz7pb1JoJkbS4lGNuuvAyu0gFyrdboYRC-VdFIuxmDrHKiG2n3PvOrOm_hyyoMPbJXsGxfldUJgEhLIK8YbY0N7gJ0aWQ3hESFtvK73R=w2400\" alt=\"\"></p>\r\n<p>Alternatively, go to <a href=\"https://changelly.com/\">https://changelly.com/</a> where you can do the same.</p>\r\n<ol start=\"2\">\r\n<li>Convert the amount required from your local currency to Tron or TRX</li>\r\n<li>Click on Exchange Now where you will see various rates</li>\r\n<li>Once selected follow the instructions onscreen. You may need to do a KYC</li>\r\n<li>You will be asked to enter your wallet ID or where you want to send the asset to.</li>\r\n<li>Go to the wallet created on TronLink and copy and paste the wallet ID accordingly</li>\r\n</ol>\r\n<p><img src=\"https://lh3.googleusercontent.com/PlrUqiQaUI0ltToEbWJdHEVAGBK1okWjdEu6kcADqz-_EHawq5qZrRutmwkTHHGsQ9W8w8f-o7nfimTA_y9uJKjPonaq0S4k9YCUblplULvF_3ncB1HC0zCjotjjQzJ2sNNP1jBh=w2400\" alt=\"\"></p>\r\n<p>Once the transaction has been completed successfully, you will now see funds appear on your Tron Link Wallet. You can press \"Refresh\" on your wallet to double check.</p>',NULL,NULL,'2021-05-16 20:25:37','2021-05-16 20:21:31',1),(56,NULL,1,'How To Join Step 3: Join Tron Googol','<p><strong>DESKTOP</strong></p>\r\n<ol>\r\n<li>To join from your desktop, paste the link provided by the person who introduced you or from the email received from Tron Googol.</li>\r\n<li>Click on the TronLink icon on your Chrome Browser and log in <img src=\"https://lh3.googleusercontent.com/24syKjmKqK6EpoeScB0hwP84z4GNfpbzShkWLVhdybY5l8vmE8tck4jnzPjyq9F2dF0-tfjwqrSZhmPqRsK_ls_zg3WwaoLgjdbZaMw7V2c6xcty-2VZlKVQvKFZOcn_YXXYoaGi=w2400\" alt=\"\"></li>\r\n<li>Click on the Wallet so that is open</li>\r\n<li>Your wallet is now connected to the DApp (decentralised application i.e., Tron Googol).</li>\r\n<li>To confirm this you will receive a success message which displays in green on the top right of the screen</li>\r\n</ol>\r\n<p><img src=\"https://lh3.googleusercontent.com/zGj9UmUJKymNUQPBJV4YxOJhdbJdG5_yVxbmn4r7MdrVIXssZGjGAQIPnaRBDGRwBYmhZTzfK6KgWzzTjG7zdUVqNeiRHQvnVybzSBXdgEv4DV23SDcqeMOZ4laHJZBUh12k7FAK=w2400\" alt=\"\"></p>\r\n<ol start=\"6\">\r\n<li>There are times when the message received from the Tron Blockchain is delayed. Therefore, you need to clear the cache before joining.</li>\r\n</ol>\r\n<p>To do this for PC users Press and hold the button <strong>CTRL</strong> on your keyboard and then press <strong>F5</strong> and let go</p>\r\n<p>For Apple Mac users, press and hold the <strong>Cmd</strong> button<strong>, Shift</strong> and the letter “<strong>R</strong>”.</p>\r\n<p>This will refresh the page and you should see the green notice box as shown above.</p>\r\n<p>If the green notice box does not show, press the repeat the steps to clear your browser cache until it does. (Ctrl F5 or Cmd Shift + R).</p>\r\n<p>Once you can see the green box, navigate to the \"Join\" button on the Tron Googol website. Then Press the text where it says \"Entry $25\"</p>',NULL,NULL,'2021-05-16 20:32:22','2021-05-16 20:31:49',1),(57,NULL,1,'When will I get paid?','<p>The payments work in 4 cycles.</p>\r\n<p>The nature of Tron Googol is that the purple positions pay other purple positions, pink positions pay other pink positions. Green positions pay other green position.</p>\r\n<p>In order to fully understand how the payments work, we suggest watching the official business presentation.</p>\r\n<p><a href=\"https://youtu.be/AIxQRhDbhjc\">https://youtu.be/AIxQRhDbhjc</a></p>\r\n<p><strong>Cycle 1:</strong></p>\r\n<p>This gets paid when your first board of 63 people has been populated.</p>\r\n<p><strong>Cycle 2:</strong></p>\r\n<p>The first board then gets split into 8 separate boards.</p>\r\n<p>When all of the boards are filled, you then get your cycle 2 payment.</p>\r\n<p><strong>Cycle 3:</strong></p>\r\n<p>The 8 boards then get split into 8 boards each.</p>\r\n<p>Once these 64 boards have been filled, you then get your cycle 3 payment</p>\r\n<p><strong>Cycle 4:</strong></p>\r\n<p>Those 64 boards then get split into 8 each.</p>\r\n<p>Once those 512 boards get filled, you then get paid your cycle 4 payment.</p>\r\n<p>The cycle 4 payment is just over $25k, $50k or $100k depending on the board</p>\r\n<p><strong>Re-Entry:</strong></p>\r\n<p>Once you have completed cycle 4, you automatically get re-entered onto the board.</p>\r\n<p>As others also complete their cycle 4, they also get automatically populated on the board.</p>\r\n<p>This means you can potentially earn passively from an one time effort.</p>',NULL,NULL,'2021-05-16 20:52:55','2021-05-16 20:51:21',1),(58,NULL,1,'Will my referral link change?','No your referral link will never change. It will always remain the same. Remember if your 1st board has been filled, if they join using your link, they will join one of the next 8 boards. If those are also filled, it will join one of the next set of boards which have an empty position. Participants that join using your link, will always remain in your network of 4 cycles. ',NULL,NULL,'2021-05-16 20:55:48','2021-05-16 20:53:49',1),(59,NULL,1,'I have received a Sending Transaction Failed error message','<p>The sending transaction failed error message can appear even though you have frozen Tron. The reason is typically because the total amount of Tron that you have available plus the frozen Tron is less than the amount required to join.</p>\r\n<p>For example, if you need 400 TRX to join and your account balance shows 450 TRX. However, you have frozen 100 TRX. Therefore, you only have 350 TRX to join and therefore do not have enough TRX for the transaction.</p>\r\n<p>To view how much TRX you have available follow these steps:</p>\r\n<ol>\r\n<li>Log onto your TronLink Pro wallet</li>\r\n<li>Select the menu option by clicking on the 3 lines on the top right</li>\r\n</ol>\r\n<p><img src=\"https://lh3.googleusercontent.com/IahDccikXnAe2GVVds837NfH2xMZAqFnaSeKqeEsnpxlzV34PrF_kMOAJl59czCZinB_ZXijMeO7l36t_zEbslHJo42Ym98tQ6j-MVw6e_TbW2ZLeJyI7B7RFhOfQ3tHiGk-a8MG=w2400\" alt=\"\"></p>\r\n<ol start=\"3\">\r\n<li>Click on Account Details which open up a new window on your browser</li>\r\n</ol>\r\n<p><img src=\"https://lh3.googleusercontent.com/VLfnDs_dxj16W7RbZvEGzYrW-M0Vz6Oo62ggZbEByFcwgL8EIPPyieY9v9NpaFfW247DCy88NLx84-9gcw3uK8-HYeF_0ytn0q-uH3Ozz_bDFf-FR5Z2TZbmh7TPSeyvuitL9JHo=w2400\" alt=\"\"></p>\r\n<ol start=\"4\">\r\n<li>On the top left you will see your Total Assets.</li>\r\n<li>Directly underneath you will see how much of this is available to use</li>\r\n</ol>\r\n<p> </p>\r\n<p>Example:</p>\r\n<p><img src=\"https://lh3.googleusercontent.com/p80FS23fxbBroa_b0V9RxgpD9PEEc8ecGLp_g8S5KyBEVke9t20gvDT-k3TAXq8UJflzLHVdqplyHJf4oaCQkY4Z4ojidLV881iysVGtiVwvPzjCZrUjGNk122QqJqRDJx0swe55=w2400\" alt=\"\" width=\"860\" height=\"513\"></p>',NULL,NULL,'2021-05-16 21:04:34','2021-05-16 20:57:38',1),(60,NULL,1,'I have received a Submit Failed error message','<p>You may receive the “Submit Failed” error message for the following reasons:</p>\r\n<ol>\r\n<li>Block rollback</li>\r\n</ol>\r\n<p>Your order might fail if the MainNet is experiencing block rollback.<br><br></p>\r\n<ol start=\"2\">\r\n<li>Failure to call contracts</li>\r\n</ol>\r\n<p><strong>Your order might fail when contracts cannot be called, which will happen if you do not have enough Energy, bandwidth or token balance in your address.</strong></p>\r\n<p>Transaction consumes your bandwidth and Energy. You can obtain bandwidth and Energy by freezing TRX, or make sure that there are enough TRX in your account balance for burning<br><br></p>\r\n<ol start=\"3\">\r\n<li>Network Delay</li>\r\n</ol>\r\n<p>Occasional MainNet delay or unstable nodes might affect your order.</p>\r\n<p><strong>When “Submit Failed” occurs, we advise you to wait for a while.</strong></p>',NULL,NULL,'2021-05-16 21:07:26','2021-05-16 21:06:00',1);
