INSERT INTO `tgg_how_it_works` VALUES (1,0,'COMMUNITY UPLIFTMENT PROJECTS','If you know of a project which will be going to uplift a community, please do let us know the story and we will connect with you. ','Countries have a lot of work to do to achieve the United Nations’ Sustainable Development Goals by 2030. But the development of projects doesn’t always go the way you expect. Therefore, it is the responsibility of the public and well as private entities to come forward together in whatever capacity each one can do to assist in sustainable development projects. The TRON GOOGOL Community is dedicated and will play a very important role by participating in different community projects to facilitate and uplift underprivileged in the areas of EDUCATION, SANITATION, DRINKING WATER,  HEALTH & MEDICAL.<br><br>The world is facing a dire emergency. Now, more than ever, we need access to science and facts – not vested interests. You & us can help together.<br><br>If you know of a project which will be going to uplift a community, please do let us know the story and we will connect with you to listen to your stories to find a way to assist communities seeking assistance. For information, please send an email to sd@troongoogol.io. ',NULL,1,'2021-02-17 06:09:37','2020-12-14 18:30:00',1),(2,0,'GIVING FORWARD','As a community, we will pay forward to changing someone else\'s circumstances for the better. Let us join hands together.','The mission of GIVING FORWARD  is to unite the Tron Googol community to come forward by creating awareness and raising money for charitable endeavors that directly impact those close to us.<br><br>GF (Giving Forward) is formed in order to help those who may need a little extra help in life. We may not all have a lot to give, but we can all help in giving back by assisting together. Whether it is an issue where someone is suffering in diseases such as diabetes or cancer, or something closer to our community such as helping a family who lost everything in a house fire. There are so many unforeseen challenges faced by so many people all over the world. Our goal is to give forward by creating awareness about our community which supports people in need and raises money for charities that directly impact those close to us. GF consists of ordinary people like you and me, with normal everyday jobs that want to give back in any way that we can to uplift others from miseries.<br><br>There is a lot to do in order to get GF where we want it. Volunteers will be needed for our upcoming Ride. In addition, GF is welcoming community members and business professionals alike to join our team. Help us help others in our GF initiative.<br><br>\nYou can contribute to GIVING FORWARD FUND by sending TRX to the following address;<br>TUZSE5AZRWgcMJRfsA8DeS9cCDvqCJ8iER.<br><br>There is no cap to how much you want to contribute. It is totally up to you. All funds contributed by the Tron Googol Community will be used for the GIVING FORWARD initiative. Please be requested to send the transaction HASH to gf@trongoogol.io along with your name, email, and contact details once the transaction is made. We will publish your name as a note of thanks for coming forward to assist people in need.<br><br>Thank you',NULL,1,'2021-02-15 07:31:47','2020-12-14 18:30:00',1),(3,0,'HOW TO JOIN AND REJOIN?','Once you have filled the board and reached the income of the Core 7 board, you can re-enter these boards as many times as you want. ','Once you have filled the board and reached the income of the Core 7 board, you can re-enter these boards as many times as you want.<br><br>~There are 3 boards where you need US $ 25, US $ 50 & US $ 100 of Tron Cryptocurrency for starting participating in these boards. You can join either one or two or all three boards at the same time.<br>~Once you have filled a board and reached the income of the board, you can reenter these boards as many times as you want to achieve the maximum income for each one of these boards.<br>~There is no end to how much you can make. Participate in the boards as many times as you want.',NULL,1,'2021-02-17 04:54:18','2020-12-14 18:30:00',1),(4,0,'WHEN THE BOARD GETS FILLED','You will earn US $ 25, 967.75, US $ 51,917.50 & US $ 103,835 over and over again from 3 boards respectively.','You will earn US $ 25, 967.75, US $ 51,917.50 & US $ 103,835 over and over again from 3 boards respectively.<br><br>Please watch the Video Presentation here to learn how https://youtu.be/DQ9Jbs-oPb8',NULL,1,'2021-02-17 04:32:16','2020-12-14 18:30:00',1),(5,0,'HISTORY OF GIVING','Crowdfunding may seem like a new idea, but it actually has a long and rich history with roots going back to the 1700’s.','Crowd-funding may seem like a new idea, but it actually has a long and rich history with roots going back to the 1700’s. Some of the finding in different cultures of the world are as below.<br><br>ASIAN CULTURE<br><br>Members of a family will put in money to contribute to one family getting a business. All members will work at that one family’s business until enough wealth is generated to open the next family’s business.<br><br>JAMAICAN CULTURE<br><br>Individuals come together by giving designated person a certain amount of money on a weekly basis and at the end of the year that you have contributed is returned in totality. There is no additional profit is made on the contribution.<br><br>HISPANIC CULTURE<br><br>Families contribute a weekly set amount to a certain family for a set period of time. One the time is fulfilled, each family continues to contribute and the next family collects. There is also no profit made on this contribution.',NULL,1,'2021-02-17 04:28:34','2020-12-14 18:30:00',1),(6,0,'TEAM\'S COMMITMENT','How do I fit into the team\'s commitment circle? I AM A VISUAL PERSON. PLEASE SHOW ME WHAT THE GIVE-IN-CYCLE LOOKS LIKE. ','How do I fit into the team\'s commitment circle?<br><br>~I AM A VISUAL PERSON. <br>~PLEASE SHOW ME WHAT THE GIVE-IN-CYCLE LOOKS LIKE.<br><br>Please watch the Video Presentation here https://youtu.be/DQ9Jbs-oPb8',NULL,1,'2021-02-17 03:50:14','2020-12-16 07:02:24',1),(7,0,'HOW WILL THIS INFLUENCE YOU?','It is an amazing opportunity that can potentially change\r\nthe trajectory of your financial life.','It is an amazing opportunity that can potentially change the trajectory of your financial life.<br><br>Created for generating WEALTH FOR LIKE-MINDED PEOPLE by working as a community to reach personal and professional goals by displaying equal efforts to achieve equal outcomes.',NULL,1,'2021-02-17 03:39:58','2020-12-16 07:02:48',1),(8,0,'WHY WOULD YOU JOIN? ','If you where given US $ 181,720.25 in the next 3 weeks, what would you do with it?','If you were given US $ 181,720.25 in the next 3 weeks, what would you do with it?<br><br>~Maybe you want to pay of DEBT<br>~Maybe you want to purchase a HOME<br>~Maybe you want to own a BUSINESS<br>~Or Maybe you want to INVEST<br><br>ARE YOU WILLING TO COMMIT FILLING THIS WONDERFUL BOARD?<br><br>~All that you need is your 2 and they need their 2 to fill the board with 63 members.<br>~If you want, you can fill the board within a day and re-enter as many times you want.',NULL,1,'2021-02-17 03:40:56','2020-12-14 18:30:00',1),(9,0,'कम्युनिटी अप्लीकेशन प्रॉजेक्ट्स','यदि आप एक ऐसी परियोजना के बारे में जानते हैं जो एक समुदाय के उत्थान के लिए होगी, तो कृपया हमें कहानी बताएं और हम आपके साथ जुड़ेंगे।','2030 तक संयुक्त राष्ट्र के सतत विकास लक्ष्यों को प्राप्त करने के लिए देशों के पास बहुत सारे काम हैं। लेकिन परियोजनाओं का विकास हमेशा आपकी अपेक्षा के अनुरूप नहीं होता है। इसलिए, यह सार्वजनिक और अच्छी तरह से निजी संस्थाओं की ज़िम्मेदारी है कि वे सभी को एक साथ आगे आने की क्षमता में, जो कि हर कोई स्थायी विकास परियोजनाओं में सहायता कर सकें। TRON GOOGOL समुदाय समर्पित है और विभिन्न सामुदायिक परियोजनाओं में भाग लेने के लिए एक बहुत महत्वपूर्ण भूमिका निभाएगा, जो शिक्षा, शिक्षा, पेयजल, स्वास्थ्य और चिकित्सा के क्षेत्रों में वंचितों के उत्थान के लिए है। <br> <br> <br> <br> <br> <br> घोर आपातकाल। अब, पहले से कहीं अधिक, हमें विज्ञान और तथ्यों तक पहुंच की आवश्यकता है - निहित स्वार्थ नहीं। आप और हम एक साथ मदद कर सकते हैं। <br> <br> यदि आप एक ऐसी परियोजना के बारे में जानते हैं, जो किसी समुदाय के उत्थान के लिए होगी, तो कृपया हमें कहानी बताएं और रास्ता खोजने के लिए हम आपकी कहानियों को सुनने के लिए आपसे जुड़ेंगे। सहायता के लिए समुदायों की सहायता करना। जानकारी के लिए, कृपया sd@troongoogol.io पर ईमेल भेजें।',NULL,3,'2021-02-17 16:40:34','2021-01-08 04:48:51',1),(10,0,'आगे बढ़ते हुए','एक समुदाय के रूप में, हम बेहतर के लिए किसी और की परिस्थितियों को बदलने के लिए भुगतान करेंगे। आइए हम आपस में हाथ मिलाएं।','एक समुदाय के रूप में, हम बेहतर के लिए किसी और की परिस्थितियों को बदलने के लिए आगे भुगतान करेंगे। आइए हम आपस में हाथ मिलाएं। <br> <br> GIVING FORWARD का मिशन ट्रोन गोगोल समुदाय को एकजुट करने के लिए जागरूकता पैदा करके और धर्मार्थ प्रयासों के लिए पैसा जुटाना है जो सीधे हमारे करीब वालों को प्रभावित करते हैं। <br> <br> GF (गिविंग फॉरवर्ड) का गठन उन लोगों की मदद के लिए किया जाता है, जिन्हें जीवन में थोड़ी अतिरिक्त मदद की आवश्यकता हो सकती है। हम सभी के पास देने के लिए बहुत कुछ नहीं हो सकता है, लेकिन हम सभी एक साथ सहायता करके वापस देने में मदद कर सकते हैं। चाहे वह कोई ऐसा मुद्दा हो जहां कोई व्यक्ति मधुमेह या कैंसर जैसी बीमारियों से पीड़ित हो, या हमारे समुदाय के करीब हो जैसे कि एक परिवार की मदद करना जिसने घर की आग में अपना सब कुछ खो दिया। पूरी दुनिया में इतने सारे लोगों के सामने कई अप्रत्याशित चुनौतियां हैं। हमारा लक्ष्य हमारे समुदाय के बारे में जागरूकता पैदा करके आगे बढ़ाना है जो लोगों की ज़रूरतों का समर्थन करता है और उन दान के लिए धन जुटाता है जो सीधे हमारे करीब वालों को प्रभावित करते हैं। GF में आपके और मेरे जैसे सामान्य लोग होते हैं, जो रोज़मर्रा की सामान्य नौकरियों के साथ हैं, जो किसी भी तरह से वापस देना चाहते हैं ताकि हम दूसरों को दुखों से ऊपर उठा सकें। <br> <br> GF को पाने के लिए बहुत कुछ करना होगा जहाँ हम यह चाहता हूँ। हमारी आने वाली सवारी के लिए स्वयंसेवकों की आवश्यकता होगी। इसके अलावा, GF हमारी टीम में शामिल होने के लिए समुदाय के सदस्यों और व्यावसायिक पेशेवरों का समान रूप से स्वागत कर रही है। हमारे GF पहल में दूसरों की मदद करने में मदद करें। <br> <br> आप निम्न पते पर TRX भेजकर फॉरवर्ड फ़ाउंड को प्राप्त करने में योगदान कर सकते हैं; योगदान करना। यह पूरी तरह से आप पर निर्भर है। ट्रोन गोगोल समुदाय द्वारा योगदान किए गए सभी फंड का उपयोग GIVING FORWARD पहल के लिए किया जाएगा। लेन-देन के लिए कृपया अपने नाम, ईमेल और संपर्क विवरण के साथ gf@trongoogol.io पर लेनदेन एचएएसएच भेजने का अनुरोध करें। जरूरतमंद लोगों की सहायता के लिए हम आपके नाम को धन्यवाद के नोट के रूप में प्रकाशित करेंगे। <br> <br> धन्यवाद',NULL,3,'2021-02-17 16:37:51','2021-01-08 04:48:59',1),(11,0,'कैसे शामिल करें और फिर से जुड़ने के लिए?','एक बार जब आप बोर्ड भर चुके होते हैं और कोर 7 बोर्ड की आय तक पहुँच जाते हैं, तो आप इन बोर्डों को जितनी बार चाहें उतनी बार फिर से दर्ज कर सकते हैं।','एक बार जब आप बोर्ड भर चुके होते हैं और कोर 7 बोर्ड की आय तक पहुँच जाते हैं, तो आप इन बोर्डों को जितनी बार चाहें उतनी बार फिर से दर्ज कर सकते हैं। <br> <br> ~ 3 बोर्ड ऐसे हैं जहाँ आपको US $ 25, US $ की आवश्यकता होती है। इन बोर्डों में भाग लेने के लिए ट्रॉन क्रिप्टोकरेंसी के 50 और यूएस $ 100। आप एक ही समय में एक या दो या सभी तीन बोर्डों में शामिल हो सकते हैं। <br> ~ एक बार जब आप एक बोर्ड भर चुके होते हैं और बोर्ड की आय तक पहुँच जाते हैं, तो आप इन बोर्डों को जितनी बार चाहें उतनी बार पुनः प्राप्त कर सकते हैं। इन बोर्डों में से प्रत्येक के लिए। <br> ~ आप कितना बना सकते हैं इसका कोई अंत नहीं है। कई बार \"n\" बोर्ड में भाग लें।',NULL,3,'2021-02-17 07:27:03','2021-01-08 04:49:01',1),(12,0,'जब बोर्ड भर जाता है','आप 3 बोर्ड से क्रमशः $ 25, 967.75, US $ 51,917.50 और US $ 103,835 कमाएँगे।','आप क्रमशः 3 बोर्ड पर $ 25, 967.75, US $ 51,917.50 और US $ 103,835 कमाएँगे। <br> <br> कृपया वीडियो प्रस्तुति देखने के लिए यहां देखें कि कैसे https://youtu.be/DQ9Jbs oPb8',NULL,3,'2021-02-17 07:09:19','2021-01-08 04:49:03',1),(13,0,'देने का इतिहास','क्राउड-फंडिंग एक नए विचार की तरह लग सकता है, लेकिन इसका वास्तव में एक लंबा और समृद्ध इतिहास है जिसकी जड़ें 1700 तक हैं।','क्राउड-फंडिंग एक नए विचार की तरह लग सकता है, लेकिन इसका वास्तव में एक लंबा और समृद्ध इतिहास है जिसकी जड़ें 1700 तक हैं। दुनिया की विभिन्न संस्कृतियों में कुछ निम्नानुसार हैं। <br> <br> Asian संस्कृति <br> <br> एक परिवार के सदस्य एक व्यवसाय में एक परिवार को योगदान देने के लिए पैसे लगाएंगे। सभी सदस्य उस एक परिवार के व्यवसाय पर काम करेंगे, जब तक कि अगले परिवार के व्यवसाय को खोलने के लिए पर्याप्त धन न उत्पन्न हो जाए। <br> <br> JAMAICAN संस्कृति<br> <br> <br> व्यक्ति एक निर्दिष्ट राशि एक साप्ताहिक पर एक निश्चित राशि देकर आते हैं। आधार और आपके द्वारा योगदान किए गए वर्ष के अंत में समग्रता में वापस कर दिया जाता है। योगदान पर कोई अतिरिक्त लाभ नहीं मिलता है। <br> <br> HISPANIC संस्कृति <br> <br> परिवार एक निश्चित समय के लिए एक निश्चित परिवार के लिए साप्ताहिक सेट राशि का योगदान करते हैं। एक समय पूरा हो गया है, प्रत्येक परिवार योगदान देना जारी रखता है और अगला परिवार इकट्ठा होता है। इस योगदान पर कोई लाभ नहीं हुआ है।',NULL,3,'2021-02-17 07:07:10','2021-01-08 04:49:06',1),(14,0,'एक महीने के प्रतिबद्धता','मैं टीम के प्रतिबद्धता सर्कल में कैसे फिट हो सकता हूं? मैं एक दृश्य व्यक्ति हूं। कृपया मुझे GIVE-IN-CYCLE लुक्स पसंद है।','मैं टीम के प्रतिबद्धता चक्र में कैसे फिट हो सकता हूं? <br> <br> ~ I AM A VISUAL PERSON। <br> ~ कृपया मुझे यह बताएं कि GIVE-IN-CYCLE लुक्स पसंद है। <br> <br> कृपया वीडियो प्रस्तुति यहां देखें https://youtu.be/DQ9Jbs-oPb8',NULL,3,'2021-02-17 07:04:25','2021-01-08 04:49:08',1),(15,0,'कैसे यह प्रभाव आप करेंगे?','यह एक अद्भुत अवसर है जो संभावित रूप से आपके वित्तीय जीवन के प्रक्षेपवक्र को बदल सकता है।','यह एक अद्भुत अवसर है जो संभावित रूप से आपके वित्तीय जीवन के प्रक्षेपवक्र को बदल सकता है। <br> <br> समान परिणामों को प्राप्त करने के लिए समान प्रयासों को प्रदर्शित करके व्यक्तिगत और व्यावसायिक लक्ष्यों तक पहुंचने के लिए एक समुदाय के रूप में काम करके WEALTH FOR LIKE MINDED PEOPLE के लिए जनरेट किया गया।',NULL,3,'2021-02-17 06:49:20','2021-01-08 04:49:10',1),(16,0,'क्यों करेंगे आप में शामिल?','यदि आपको अगले 3 सप्ताह में US $ 181,720.25 दिया गया, तो आप इसके साथ क्या करेंगे?','अगर आपने अगले 3 सप्ताह में US $ 181,720.25 दिया है, तो आप इसके साथ क्या करेंगे? <br> <br> ~ शायद आप DEBT का भुगतान करना चाहते हैं <br> ~ शायद आप एक घर खरीदना चाहते हैं आप अपना खुद का व्यवसाय करना चाहते हैं - ~ या हो सकता है कि आप निवेश करना चाहते हैं - क्या आप अपने ग्राहकों को इस बोर्ड को पूरा करने के लिए तैयार कर रहे हैं? <br> <br> ~ आप चाहते हैं कि सभी आपके 2 हैं और उन्हें उनकी आवश्यकता है? 63 सदस्यों के साथ बोर्ड को भरने के लिए 2। <br> ~ यदि आप चाहें, तो आप एक दिन के भीतर बोर्ड भर सकते हैं और जितनी बार चाहें उतनी बार फिर से प्रवेश कर सकते हैं।',NULL,3,'2021-02-17 06:46:57','2021-01-08 04:49:12',1),(17,0,'DỰ ÁN CỘNG ĐỒNG','Nếu bạn biết về một dự án sẽ nâng cao cộng đồng, vui lòng cho chúng tôi biết câu chuyện và chúng tôi sẽ kết nối với bạn.','Các quốc gia còn rất nhiều việc phải làm để đạt được Mục tiêu Phát triển Bền vững của Liên hợp quốc vào năm 2030. Nhưng không phải lúc nào việc phát triển các dự án cũng diễn ra theo cách bạn mong đợi. Vì vậy, trách nhiệm của các tổ chức công và tư nhân là phải cùng nhau tiến lên trong bất kỳ khả năng nào mà mỗi bên có thể làm để hỗ trợ các dự án phát triển bền vững. Cộng đồng TRON GOOGOL tận tâm và sẽ đóng một vai trò rất quan trọng bằng cách tham gia vào các dự án cộng đồng khác nhau để tạo điều kiện và nâng cao những người kém may mắn trong các lĩnh vực GIÁO DỤC, VỆ SINH, NƯỚC UỐNG, SỨC KHỎE & Y T khẩn cấp nghiêm trọng. Giờ đây, hơn bao giờ hết, chúng ta cần tiếp cận với khoa học và sự thật - chứ không phải quyền lợi. Bạn và chúng tôi có thể giúp đỡ nhau. <br> <br> Nếu bạn biết về một dự án sẽ nâng cao sức mạnh cộng đồng, vui lòng cho chúng tôi biết câu chuyện và chúng tôi sẽ kết nối với bạn để lắng nghe câu chuyện của bạn để tìm ra cách để hỗ trợ các cộng đồng đang tìm kiếm sự trợ giúp. Để biết thông tin, vui lòng gửi email đến sd@troongoogol.io.',NULL,4,'2021-02-17 17:27:13','2020-12-16 06:50:06',1),(18,0,'TẶNG TIỀN','Là một cộng đồng, chúng tôi sẽ mong muốn thay đổi hoàn cảnh của người khác để tốt hơn. Chúng ta hãy cùng nhau chung tay.','Là một cộng đồng, chúng tôi sẽ mong muốn thay đổi hoàn cảnh của người khác để tốt hơn. Chúng ta hãy cùng nhau chung tay. <br> <br> Sứ mệnh của GIVING FORWARD là đoàn kết cộng đồng Tron Googol để cùng tiến lên bằng cách tạo ra nhận thức và quyên góp tiền cho những nỗ lực từ thiện tác động trực tiếp đến những người thân thiết với chúng ta. <br> <br> GF (Giving Forward) được thành lập để giúp đỡ những người có thể cần thêm một chút giúp đỡ trong cuộc sống. Tất cả chúng ta có thể không có nhiều thứ để cho đi, nhưng tất cả chúng ta đều có thể giúp đỡ bằng cách hỗ trợ cùng nhau. Cho dù đó là vấn đề ai đó đang mắc các bệnh như tiểu đường hoặc ung thư, hay một vấn đề gì đó gần gũi hơn với cộng đồng của chúng ta, chẳng hạn như giúp đỡ một gia đình bị mất mọi thứ trong vụ cháy nhà. Có rất nhiều thách thức không lường trước được mà rất nhiều người trên khắp thế giới phải đối mặt. Mục tiêu của chúng tôi là tạo ra nhận thức về cộng đồng của chúng tôi, nơi hỗ trợ những người cần và gây quỹ cho các tổ chức từ thiện có tác động trực tiếp đến những người thân thiết với chúng tôi. GF bao gồm những người bình thường như bạn và tôi, với những công việc bình thường hàng ngày muốn đền đáp lại bằng mọi cách mà chúng ta có thể nâng đỡ người khác khỏi những khốn khó. <br> <br> Có rất nhiều việc phải làm để có được GF ở nơi chúng ta muốn nó. Tình nguyện viên sẽ cần thiết cho Chuyến đi sắp tới của chúng tôi. Ngoài ra, GF cũng hoan nghênh các thành viên cộng đồng và các chuyên gia kinh doanh tham gia vào nhóm của chúng tôi. Giúp chúng tôi giúp đỡ những người khác trong sáng kiến ​​GF của chúng tôi. <br> <br> Bạn có thể đóng góp vào việc TẶNG QUỸ TIỀN TỆ bằng cách gửi TRX đến địa chỉ sau; <br> TUZSE5AZRWgcMJRfsA8DeS9cCDvqCJ8iER. <br> <br> Không có giới hạn về số tiền bạn muốn đóng góp. Điều đó hoàn toàn tùy vào bạn. Tất cả các quỹ do Cộng đồng Tron Googol đóng góp sẽ được sử dụng cho sáng kiến ​​GIVING FORWARD. Vui lòng gửi HASH giao dịch đến gf@trongoogol.io cùng với tên, email và chi tiết liên hệ của bạn khi giao dịch được thực hiện. Chúng tôi sẽ công bố tên của bạn như một lời cảm ơn vì đã tiếp tục hỗ trợ những người cần. <br> <br> Cảm ơn bạn',NULL,4,'2021-02-17 17:14:50','2020-12-16 06:52:12',1),(19,0,'LÀM THẾ NÀO ĐỂ THAM GIA VÀ THAM GIA?','Khi bạn đã điền vào bảng và đạt đến thu nhập của bảng Core 7, bạn có thể nhập lại các bảng này bao nhiêu lần tùy ý','Khi bạn đã điền vào bảng và đạt đến thu nhập của bảng Core 7, bạn có thể nhập lại các bảng này bao nhiêu lần tùy thích. <br> <br> ~ Có 3 bảng mà bạn cần US $ 25, US $ 50 & 100 đô la Mỹ tiền điện tử Tron để bắt đầu tham gia vào các hội đồng này. Bạn có thể tham gia một hoặc hai hoặc cả ba hội đồng cùng một lúc. <br> ~ Khi bạn đã điền vào một hội đồng và đạt đến thu nhập của hội đồng, bạn có thể tham gia lại những hội đồng này bao nhiêu lần tùy thích để đạt được thu nhập tối đa cho mỗi một trong những bảng này. <br> ~ Không có kết thúc cho bao nhiêu bạn có thể kiếm được. Tham gia vào các ban \"n\" số lần.',NULL,4,'2021-02-17 17:11:52','2020-12-16 06:52:30',1),(20,0,'KHI BAN ĐƯỢC ĐIỀN','Bạn sẽ kiếm được 25, 967,75 đô la Mỹ, 51.917,50 đô la Mỹ và 103.835 đô la Mỹ lặp đi lặp lại từ 3 bảng tương ứng.','Bạn sẽ kiếm được 25, 967,75 đô la Mỹ, 51.917,50 đô la Mỹ và 103.835 đô la Mỹ lặp đi lặp lại từ 3 bảng tương ứng. <br> <br> Vui lòng xem Video Trình bày tại đây để tìm hiểu cách thực hiện https://youtu.be/AIxQRhDbhjc',NULL,4,'2021-02-17 17:07:11','2020-12-16 06:52:51',1),(21,0,'LỊCH SỬ CHO ĐI','Huy động vốn từ cộng đồng có vẻ như là một ý tưởng mới, nhưng nó thực sự có một lịch sử lâu đời và phong phú với nguồn gốc từ những năm 1700.','Huy động vốn từ cộng đồng có vẻ như là một ý tưởng mới, nhưng nó thực sự có một lịch sử lâu đời và phong phú với nguồn gốc từ những năm 1700. Dưới đây là một số phát hiện ở các nền văn hóa khác nhau trên thế giới. <br> <br> VĂN HÓA CHÂU Á <br> <br> Các thành viên trong một gia đình sẽ bỏ tiền ra để đóng góp cho một gia đình thành lập doanh nghiệp. Tất cả các thành viên sẽ làm việc tại cơ sở kinh doanh của một gia đình đó cho đến khi tạo ra đủ tài sản để mở cơ sở kinh doanh của gia đình tiếp theo. <br> <br> VĂN HÓA JAMAICAN <br> <br> Các cá nhân đến với nhau bằng cách cho người được chỉ định một số tiền nhất định hàng tuần cơ sở và vào cuối năm mà bạn đã đóng góp được trả lại toàn bộ. Không có lợi nhuận bổ sung nào được thực hiện khi đóng góp. <br> <br> VĂN HÓA HISPANIC <br> <br> Các gia đình đóng góp một số tiền cố định hàng tuần cho một gia đình nhất định trong một khoảng thời gian nhất định. Một lần hoàn thành, mỗi gia đình tiếp tục đóng góp và gia đình tiếp theo thu. Cũng không có lợi nhuận được thực hiện trên đóng góp này.',NULL,4,'2021-02-17 17:03:43','2020-12-16 06:53:14',1),(22,0,'CAM KẾT CỦA ĐỘI','Làm thế nào để tôi phù hợp với vòng cam kết của nhóm? TÔI LÀ MỘT NGƯỜI NHÌN. XIN VUI LÒNG CHO TÔI BIẾT NHỮNG GÌ NHƯ HÌNH LOOKS GIVE-IN-CYCLE.','Làm thế nào để tôi phù hợp với vòng cam kết của nhóm? <br> <br> ~ TÔI LÀ MỘT NGƯỜI THÂN THƯƠNG. <br> ~ XIN HÃY CHO TÔI BIẾT MÌNH NHƯ THẾ NÀO CỦA LOOKS GIVE-IN-CYCLE. <br> <br> Vui lòng xem Video giới thiệu tại đây https://youtu.be/AIxQRhDbhjc',NULL,4,'2021-02-17 16:54:46','2020-12-16 06:53:22',1),(23,0,'ĐIỀU NÀY SẼ ẢNH HƯỞNG ĐẾN BẠN NHƯ THẾ NÀO?','Đó là một cơ hội tuyệt vời có khả năng thay đổi quỹ đạo cuộc sống tài chính của bạn.','Đó là một cơ hội tuyệt vời có khả năng thay đổi quỹ đạo cuộc sống tài chính của bạn. <br> <br> Được tạo ra để tạo ra VŨ KHÍ CHO NHỮNG NGƯỜI CÓ TÂM NHƯ bằng cách hoạt động như một cộng đồng để đạt được các mục tiêu cá nhân và nghề nghiệp bằng cách thể hiện những nỗ lực như nhau để đạt được kết quả như nhau.',NULL,4,'2021-02-17 16:50:14','2020-12-16 06:53:31',1),(24,0,'TẠI SAO BẠN NÊN THAM GIA?','Nếu bạn nhận được 181.720,25 đô la Mỹ trong 3 tuần tới, bạn sẽ làm gì với nó?','Nếu bạn nhận được 181.720,25 đô la Mỹ trong 3 tuần tới, bạn sẽ làm gì với số tiền đó? <br> <br> ~ Có thể bạn muốn thanh toán NỢ <br> ~ Có thể bạn muốn mua NHÀ <br> ~ Có thể bạn muốn sở hữu một DOANH NGHIỆP <br> ~ Hoặc Có thể bạn muốn ĐẦU TƯ <br> <br> BẠN SẼ CAM KẾT ĐẦY ĐỦ ĐIỀU KIỆN NÀY? <br> <br> ~ Tất cả những gì bạn cần là 2 bạn và họ cần họ 2 để điền vào bảng với 63 thành viên. <br> ~ Nếu bạn muốn, bạn có thể điền vào bảng trong vòng một ngày và nhập lại bao nhiêu lần bạn muốn.',NULL,4,'2021-02-17 16:47:15','2020-12-16 06:49:37',1),(25,0,'MGA PROYEKTO NG NABUWANG KOMUNIDAD','Kung may alam ka sa isang proyekto na makakapag-aangat ng isang komunidad, mangyaring ipaalam sa amin ang kwento at makakonekta kami sa iyo.','Ang mga bansa ay may maraming gawain na dapat gawin upang makamit ang Sustainable Development Goals ng United Nations sa 2030. Ngunit ang pag-unlad ng mga proyekto ay hindi palaging umaasa sa inaasahan mong paraan. Samakatuwid, responsibilidad ng publiko at maging ng mga pribadong entity na magsama sama-sama sa anumang kakayahan na magagawa ng bawat isa upang makatulong sa mga napapanatiling proyekto sa pag-unlad. Ang Komunidad ng TRON GOOGOL ay nakatuon at gampanan ang isang napakahalagang papel sa pamamagitan ng paglahok sa iba\'t ibang mga proyekto sa pamayanan upang mapadali at mapasigla ang mga walang kapusukan sa mga lugar ng EDUCATION, SANITATION, DRINKING WATER, HEALTH & MEDICAL. <br> <br> Ang mundo ay nahaharap sa isang grabe emergency. Ngayon, higit sa dati, kailangan natin ng pag-access sa agham at mga katotohanan - hindi sa mga interes na interes. Maaari kang tumulong nang magkasama. <br> <br> Kung may alam ka sa isang proyekto na makakapag-aangat ng isang komunidad, mangyaring ipaalam sa amin ang kwento at makakonekta kami sa iyo upang makinig sa iyong mga kwento upang makahanap ng isang paraan upang matulungan ang mga pamayanan na humihingi ng tulong. Para sa impormasyon, mangyaring magpadala ng isang email sa sd@troongoogol.io.',NULL,5,'2021-02-17 18:47:36','2020-12-16 06:56:55',1),(26,0,'PAGBIBIGAY NG PARAAN','Bilang isang pamayanan, magbabayad kami ng pasulong sa pagbabago ng mga kalagayan ng ibang tao para sa mas mahusay. Magkasama tayo','Bilang isang pamayanan, magbabayad kami ng pasulong sa pagbabago ng mga kalagayan ng ibang tao para sa mas mahusay. Magsama-sama tayo. <br> <br> Ang misyon ng GIVING FORWARD ay upang pagsamahin ang pamayanan ng Tron Googol upang sumulong sa pamamagitan ng paglikha ng kamalayan at pagtipon ng pera para sa mga gawaing pangkawanggawa na direktang nakakaapekto sa mga malapit sa atin. Ang GF (Giving Forward) ay nabuo upang matulungan ang mga maaaring mangailangan ng kaunting dagdag na tulong sa buhay. Maaaring hindi tayong lahat ay may maraming ibibigay, ngunit lahat tayo ay makakatulong sa pagbawi sa pamamagitan ng pagtulong na magkasama. Kung ito man ay isang isyu kung saan ang isang tao ay nagdurusa sa mga sakit tulad ng diabetes o cancer, o isang bagay na mas malapit sa aming komunidad tulad ng pagtulong sa isang pamilya na nawala ang lahat sa sunog sa bahay. Maraming mga hindi inaasahang hamon na kinakaharap ng maraming tao sa buong mundo. Ang aming layunin ay upang magpatuloy sa pamamagitan ng paglikha ng kamalayan tungkol sa aming komunidad na sumusuporta sa mga taong nangangailangan at nagtataas ng pera para sa mga charity na direktang nakakaapekto sa mga malapit sa amin. Ang GF ay binubuo ng mga ordinaryong tao tulad mo at ako, na may normal na mga pang-araw-araw na trabaho na nais na ibalik sa anumang paraan na magagawa nating maiangat ang iba mula sa mga pagdurusa. <br> <br> Maraming dapat gawin upang makuha ang GF kung saan tayo Gusto ito. Kakailanganin ang mga boluntaryo para sa aming paparating na Pagsakay. Bilang karagdagan, tinatanggap ng GF ang mga miyembro ng komunidad at mga propesyonal sa negosyo na sumali sa aming koponan. Tulungan kaming tulungan ang iba sa aming pagkukusa ng GF. <br> <br> Maaari kang magbigay ng kontribusyon sa PAGBIBIGAY NG PUNDONG PONDO sa pamamagitan ng pagpapadala ng TRX sa sumusunod na address; <br> TUZSE5AZRWgcMJRfsA8DeS9cCDvqCJ8iER. <br> <br> Walang takip sa kung gaano mo nais upang magbigay ng kontribusyon Nasa iyo ang ganap. Ang lahat ng mga pondo na naiambag ng Komunidad ng Tron Googol ay gagamitin para sa pagbibigay ng hakbangin sa FORWARD. Mangyaring hilingin na ipadala ang transaksyon HASH sa gf@trongoogol.io kasama ang iyong pangalan, email, at mga detalye sa pakikipag-ugnay sa sandaling maisagawa ang transaksyon. Ipapalathala namin ang iyong pangalan bilang isang tala ng pasasalamat sa pagsulong upang tulungan ang mga taong nangangailangan. <br> <br> Salamat',NULL,5,'2021-02-17 18:45:23','2020-12-16 06:57:05',1),(27,0,'PAANO SUMALI AT MAG-REJOIN?','Kapag napunan mo ang board at naabot ang kita ng board ng Core 7, maaari mong ipasok muli ang mga board na ito nang maraming beses hangga\'t gusto mo.','Kapag napunan mo ang board at naabot mo ang kita ng Core 7 board, maaari mong ipasok muli ang mga board na ito nang maraming beses hangga\'t gusto mo. <br> <br> ~ Mayroong 3 board kung saan kailangan mo ng US $ 25, US $ 50 & US $ 100 ng Tron Cryptocurrency para sa pagsisimulang lumahok sa mga board na ito. Maaari kang sumali sa alinman sa dalawa o lahat ng tatlong mga board nang sabay-sabay. <br> ~ Kapag napunan mo ang isang board at naabot ang kita ng board, maaari mong ipasok muli ang mga board na ito nang maraming beses hangga\'t nais mong makamit ang maximum na kita para sa bawat isa sa mga board na ito. <br> ~ Walang katapusan kung magagawa mo. Sumali sa mga board na \"n\" bilang ng mga beses.',NULL,5,'2021-02-17 18:43:37','2020-12-16 06:57:15',1),(28,0,'KAPAG NAPUPUNAN ANG BOARD','Kikita ka ng US $ 25, 967.75, US $ 51,917.50 & US $ 103,835 nang paulit-ulit mula sa 3 board ayon sa pagkakabanggit.','Kikita ka ng US $ 25, 967.75, US $ 51,917.50 at US $ 103,835 nang paulit-ulit mula sa 3 board ayon sa pagkakabanggit. <br> <br> Mangyaring panoorin ang Video Presentation dito upang malaman kung paano https://youtu.be/AIxQRhDbhjc',NULL,5,'2021-02-17 18:40:46','2020-12-16 06:57:27',1),(29,0,'KASAYSAYAN NG PAGBIBIGAY','Ang pagpopondo sa karamihan ay maaaring mukhang isang bagong ideya, ngunit ito ay talagang may isang mahaba at mayamang kasaysayan na may mga ugat na babalik noong 1700\'s.','Ang pagpopondo sa karamihan ay maaaring mukhang isang bagong ideya, ngunit ito ay talagang may isang mahaba at mayamang kasaysayan na may mga ugat na babalik noong 1700\'s. Ang ilan sa mga natagpuan sa iba\'t ibang mga kultura ng mundo ay tulad ng nasa ibaba. <br> <br> KULTURA NG ASYA <br> <br> Ang mga miyembro ng isang pamilya ay maglalagay ng pera upang magbigay ng kontribusyon sa isang pamilya na nakakakuha ng negosyo. Ang lahat ng mga miyembro ay magtatrabaho sa negosyo ng isang pamilyang iyon hanggang sa ang sapat na yaman ay mabuo upang mabuksan ang negosyo ng susunod na pamilya. batayan at sa pagtatapos ng taon na iyong naiambag ay naibalik sa kabuuan. Walang karagdagang kita na nakuha sa kontribusyon. <br> <br> KULTURA NG HISPANIC <br> <br> Nag-aambag ang mga pamilya ng isang lingguhang itinakdang halaga sa isang tiyak na pamilya para sa isang takdang tagal ng oras. Isa sa oras na natupad, ang bawat pamilya ay patuloy na nag-aambag at ang susunod na pamilya ay nagtitipon. Wala ring kita na nakuha sa kontribusyon na ito.',NULL,5,'2021-02-17 18:38:14','2020-12-16 06:57:40',1),(30,0,'KOMITMIT NG TEAM','Paano ako magkakasya sa bilog ng pangako ng koponan? VISUAL PERSON AKO. PAKITINGIN PO KUNG ANO ANG GUSTO NG GIVE-IN-CYCLE.','Paano ako magkakasya sa bilog ng pangako ng koponan? <br> <br> ~ AKO AY TAONG VISUAL. <br> ~ PAKILIGIN PO KUNG ANO ANG GUSTO NG GIVE-IN-CYCLE. <br> <br> Mangyaring panoorin ang Video Presentation dito https://youtu.be/AIxQRhDbhjc',NULL,5,'2021-02-17 18:35:56','2020-12-16 06:57:49',1),(31,0,'PAANO PO KAYO MAG-iimpluwensyahan?','Ito ay isang kamangha-manghang pagkakataon na maaaring baguhin ang daanan ng iyong buhay pampinansyal.','Ito ay isang kamangha-manghang pagkakataon na maaaring baguhin ang daanan ng iyong buhay pampinansyal. <br> <br> Nilikha para sa pagbuo ng YAMANAN PARA SA KATINGING MINDED PEOPLE sa pamamagitan ng pagtatrabaho bilang isang pama